const Navbar = () => {
  return;
  <nav className="navbar bg-dark">
    <h1>
      <a href="#">
        <i className="fas fa-code"></i>iPicXel
      </a>
    </h1>
    <ul>
      <li>
        <a href="#"> PhotoGrapher</a>
      </li>
      <li>
        <a href="#"> Register</a>
      </li>
      <li>
        <a href="#"> SignUP</a>
      </li>
    </ul>
  </nav>;
};
export default Navbar;
